import React from "react";
import Header from "../ProductsPage/Header";
import BottomBlueBtn from "../PassBookPage/BottomBlueBtn";
// import errorImg from "./error-img.png";
function Error() {
  return (
    <>
      <Header name="User" />
      <h1>404</h1>
      <BottomBlueBtn text="Go to Home" />
    </>
  );
}

export default Error;
